import React, { Component} from "react";

export default class DashBoard extends Component{
    constructor(props){
		super(props);
		this.state ={
			selectedId:this.props.match.params.id
		}
	}
    render(){
        return(
            <div>
                DashBoard Page {this.state.selectedId}
            </div>
        )
    }
}
